# To run this code you need to install the following dependencies:
# pip install google-genai

import base64
import mimetypes
import os
from google import genai
from google.genai import types


def save_binary_file(file_name, data):
    f = open(file_name, "wb")
    f.write(data)
    f.close()
    print(f"File saved to to: {file_name}")


def generate(num_images=1):
    client = genai.Client(
        api_key=os.getenv("GEMINI_API_KEY", "YOUR_GEMINI_API_KEY_HERE"),
    )

    model = "gemini-2.5-flash-image-preview"
    contents = [
        types.Content(
            role="user",
            parts=[
                types.Part.from_bytes(
                    mime_type="image/jpeg",
                    data=base64.b64decode(
                        """"""
                    ),
                ),
                types.Part.from_text(text="""Replicate my photo inside a corrugated factory. The camera is positioned directly perpendicular to the side of the product stack, next to a roller conveyor. The product is moving from right to left. The view should be a flat, orthographic side profile, with absolutely no perspective distortion, no yaw, and no angle revealing the front or back of the stacks."""),
            ],
        )
    ]
    generate_content_config = types.GenerateContentConfig(
        temperature=1,
        response_modalities=[
            "IMAGE",
            "TEXT",
        ],
    )

    file_index = 0
    for i in range(num_images):
        for chunk in client.models.generate_content_stream(
            model=model,
            contents=contents,
            config=generate_content_config,
        ):
            if (
                chunk.candidates is None
                or chunk.candidates[0].content is None
                or chunk.candidates[0].content.parts is None
            ):
                continue
            if chunk.candidates[0].content.parts[0].inline_data and chunk.candidates[0].content.parts[0].inline_data.data:
                file_name = f"generated_image5_{file_index:04d}"
                file_index += 1
                inline_data = chunk.candidates[0].content.parts[0].inline_data
                data_buffer = inline_data.data
                file_extension = mimetypes.guess_extension(inline_data.mime_type)
                save_binary_file(f"{file_name}{file_extension}", data_buffer)
                break  # Break out of chunk loop after saving one image
            else:
                print(chunk.text)

if __name__ == "__main__":
    generate(num_images=45)  # Generate 5 images by default
